import React from "react";
import "../styles/Contacts.css";

function Contacts() {
  return (
    <div className="contacts-container">
      <h2>Emergency Contacts</h2>
      <ul>
        <li>Police: 100</li>
        <li>Ambulance: 102</li>
        <li>Women Helpline: 1091</li>
      </ul>
    </div>
  );
}

export default Contacts;
